INSERT INTO public."Entertainments"("Id", "Price", "TypeEntertainment", "Details", "Area", "Latitude", "Longitude", "CreationDate", "City", "UrlImage", "Name", "UrlSite")
VALUES  ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d448', 1200, 1, 'Единственное место в городе Томске, где Вы найдете: 1) Ресторан в стиле Европы начала XX века 2) Концертый зал с выступлениями известных артистов 3) Банкетный хол на 500 человек 4) Караоке — бар 5) Морской ресторан с бассейном', 1, 56.52435, 85.03758, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/shanson/', 'ШАНСОНЪ', 'https://shanson-tomsk.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4478', 2100, 1, 'Ресторан «Сибирь» расположен на первом этаже здания. Каждый день светлый и уютный ресторан открывает свои двери и приглашает на вкусный и полезный завтрак по системе «Шведский стол». Ассортимент нашего завтрака по-настоящему разнообразен, поэтому Вы сможете выбрать то, что нравится именно Вам от традиционно любимой каши и блинчиков до оригинальных горячих закусок. Наши повара приготовят вкуснейшую яичницу или нежнейший омлет на выбор. И наконец, так приятно начинать день с чтения новостей и почты за чашечкой ароматного крепкого кофе. Днем здесь царит атмосфера, располагающая к дружеским встречам и деловым переговорам, а вечером позвольте себе совершить гастрономическое путешествие. Авторская кухня от шеф-повара порадует гурманов и не только изысканными блюдами русской и европейской кухни.', 0, 56.47956, 84.95018, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/siberia/', 'Сибирь', 'https://forum-otel.ru/restaurants/restoran-siberia/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4479', 900, 1, 'Ресторан «БЛИЖЕ» — это место, где Вы можете встретиться со своими близкими, насладиться блюдами сибирской, итальянской и грузинской кухни, а также хорошо отдохнуть в приятной атмосфере', 3, 56.4717, 84.95244, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/nearer/', 'Ближе', 'https://vk.com/resto_blizhe'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4480', 1750, 1, 'Концепция нашего ресторана - пригласить вас в гости к настоящим сибирским купцам, угостить лучшими традиционными блюдами, характерными именно для наших широт, а главное, создать именно ту атмосферу, которая была созвучна духу того времени. Мы приветствуем смелые идеи и эксперименты, в каждом блюде мы стремимся раскрыть всё богатство бескрайней и неповторимой Сибирской природы и показать, как гармонично она может сочетаться с кулинарными традициями из самых разных уголков мира. Кроме того, «Кухтерин»  — первое заведение в Томске, где регулярно проводятся гастрономические ужины, на которых можно ознакомиться с авторскими дегустационными сетами, состоящими из нескольких блюд и напитков, объединенных определенной историей. ', 0, 56.48272, 84.95071, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/kuxterin/', 'Кухтерин', 'https://kuhterin.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4481', 1700, 1, 'На берегу просторной реки в городе Томске можно найти изумительный, гостеприимный и милый ресторан с авторской кухней под названием Река 827. Из окон авторского ресторана открывается невероятно красивый и живописный вид на речные разливы. Все блюда шеф-повар готовит по традиционным и привычным рецептам с добавлением авторской нотки. Во время обеда иди ужина обязательно обратите внимание на изысканность оформления подаваемых к толу блюд, это творчество жалко будет кушать. У ресторана есть свои парковочные места и Интернет.', 2, 56.49044, 84.94367, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/river827/', 'Река 827', 'https://vk.com/reka827'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4482', 350, 1, 'Пиццамейкеры сыпят что-то волшебное в пиццу, повара варят хитрые соусы, официанты рисуют на стаканчиках для кофе, а бариста включают стильный рок-н-ролл. И во всём этом еще больше фана, еще больше кайфа, еще больше задора! Что же есть поесть в нашем кафе? Там все те же пиццули, что вы привыкли заказывать с сайта. Но круги другого размера —25 и 30 см :) Что еще? А еще мы конечно же готовим сочные зеленые салатики! И натуральные десертики по собственным рецептам. И само собой, мы обожаем угощать наших гостей бодрейшим кофе! А самое классное, что напитки и еду можно заказать на вынос', 0, 56.47803, 84.9503, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/makeLovePizza/', 'Make Love Pizza', 'https://makelovepizza.ru/tomsk'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4483', 350, 1, 'Пиццамейкеры сыпят что-то волшебное в пиццу, повара варят хитрые соусы, официанты рисуют на стаканчиках для кофе, а бариста включают стильный рок-н-ролл. И во всём этом еще больше фана, еще больше кайфа, еще больше задора! Что же есть поесть в нашем кафе? Там все те же пиццули, что вы привыкли заказывать с сайта. Но круги другого размера —25 и 30 см :) Что еще? А еще мы конечно же готовим сочные зеленые салатики! И натуральные десертики по собственным рецептам. И само собой, мы обожаем угощать наших гостей бодрейшим кофе! А самое классное, что напитки и еду можно заказать на вынос', 0, 56.48385, 84.98229, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/makeLovePizza/', 'Make Love Pizza', 'https://makelovepizza.ru/tomsk')
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4484', 800, 1, '', 0, 56.47679, 84.96509, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/hardyGardy/', 'Харди Гарди', 'https://hurdygurdybar.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4485', 1700, 1, 'Добро пожаловать в «Мама, я дома!» — уютное место для ваших встреч. Если вы бывали в Грузии, то, наверняка, запомнили гостеприимство этой страны и радушие её жителей, а если нет, то точно наслышаны об этом. В нашем ресторане мы постарались воссоздать эту тёплую атмосферу и позаботиться о том, чтобы здесь вам было действительно хорошо. В «Мама, я дома!» вы можете познакомиться с самыми популярными представителями грузинской кухни, а также насладиться уже привычными блюдами классического европейского меню. Обед с коллегами, ужин с друзьями или важное семейное событие — мы поддержим любой вариант вашего отдыха!', 3, 56.45561, 84.95181, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/mamaYaDoma/', 'Мама, я дома', 'https://mama-ya-doma.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4486', 700, 1, '«ProCofe» – это кофейня, в которой всегда уютно и тепло, независимо от времени года и погоды за окном. Мы постарались создать для наших гостей атмосферу искреннего радушия, в которую хочется возвращаться вновь и вновь. Наша кофейня – прекрасное место для встреч с друзьями, романтического ужина или семейного обеда. Мы делаем максимум для того, чтобы каждому гостю было уютно, вкусно и хотелось снова вернуться к нам, в «ProCofe».', 0, 56.47774, 84.95032, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/proCofe/', 'ProCofe', 'https://procofe70.com/'),
