        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4488', 1000, 1, 'Буланже — это команда единомышленников. Уже 20 лет мы дарим нашим Гостям гостеприимную атмосферу, заботу и конечно же непревзойденный кофе и торты ручной работы. В каждой из сфер деятельности мы стремимся только к высокому качеству, поэтому наш кофе — это кофе класса спешелти, приготовленный профессиональными бариста, собственный обжарочный цех. Наши торты — это только натуральные ингредиенты, собранные руками наших любящих кондитеров. Наши кофейни — это радушные сотрудники, забота. Всегда рады видеть Вас в гостях!', 0, 56.47582, 84.97262, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/bulanzhe/', 'Буланже', 'https://bulange.tomsk.ru/'),
