        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4492', 1000, 1, 'Буланже — это команда единомышленников. Уже 20 лет мы дарим нашим Гостям гостеприимную атмосферу, заботу и конечно же непревзойденный кофе и торты ручной работы. В каждой из сфер деятельности мы стремимся только к высокому качеству, поэтому наш кофе — это кофе класса спешелти, приготовленный профессиональными бариста, собственный обжарочный цех. Наши торты — это только натуральные ингредиенты, собранные руками наших любящих кондитеров. Наши кофейни — это радушные сотрудники, забота. Всегда рады видеть Вас в гостях!', 1, 56.49349, 84.9553, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/bulanzhe/', 'Буланже', 'https://bulange.tomsk.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4493', 1300, 1, 'Снегири — современный бар и ресторан. Качество продукта и услуг для нас превыше всего. Мы собрали команду профессионалов, чтобы доказать, что под одной крышей может комфортно соседствовать две яркие концепции: коктейльный бар и авторская кухня. Мы одержимы идеей искреннего сервиса и стремимся стать лучшими в том, что делаем. Мы дружелюбны и открыты. Мы рады любому, кто идёт к нам с добрым сердцем и намерениями. Мы - команда! Мы - Снегири!', 2, 56.48997, 84.94772, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/snegiry/', 'Снегири', 'https://snegiri-tomsk.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4494', 1000, 1, 'Кафе-музей "Солянка". Единственный в Сибири кафе-музей', 3, 56.45864, 84.95578, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/solyanka.jpg', 'Солянка', 'https://solyanka.tomsk.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4495', 500, 1, 'Зайдите в Счастье Есть и попробуйте итальянскую кухню. В этом месте подают хорошую пиццу, пасту и суп. Многие гости приходят сюда, чтобы заказать неплохой наполеон и аппетитные вафли. В этом заведении стоит заказать хорошее вино. Обязательно закажите вкусный карамельный латте, чай или смузи. Приходите сюда со всей семьей: здесь хорошее детское меню. Потрясающий сервис - большой плюс этого ресторана', 0, 56.47307, 84.95859, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/chastest/', 'СчастьЕсть', 'https://www.gastro-family.com/#schest'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4496', 900, 1, '', 0, 56.47672, 84.96646, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/panda/', 'Панда', 'https://panda.su'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4497', 900, 1, '', 3, 56.47719, 84.97094, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/panda/', 'Панда', 'https://panda.su'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4498', 275, 1, 'Главное, на чем мы строим отношения с гостями «Клаус-кафе» - это чистота и открытость. Речь не только о той безупречной чистоте, которую мы поддерживаем в наших стенах. Наши намерения тоже чисты. Мы относимся ко всем, кто пришел к нам, не как к клиентам, а как к желанным гостям, посетившим наш дом. У нас нет цели уговорить кого-то «купить всего и побольше». Нам хочется, чтобы у нас в гостях все чувствовали себя уютно. Любому нашему гостю мы рады одинаково, любого уважаем, будь то высокопоставленная персона, деловые партнеры, большая семья или юная влюбленная пара. Наши отношения с гостями никогда не были формальными, поэтому мы внимательно прислушиваемся ко всем мнениям и пожеланиям, готовы к критике и не боимся признавать свои ошибки. Ради гостей мы готовы на многое. Но не ищите в нашем «Клаус-кафе» вездесущих телевизоров и wi-fi доступа в Интернет: в мире поглощающих свободное время цифровых технологий мы остаемся тем заповедником уюта, где вы можете неспешно пообщаться с дорогими людьми или наконец остаться наедине с самим собой.', 3, 56.46851, 84.97325, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/klaus', 'Клаус', 'https://klauscafe.ru/'),
