        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4500', 1500, 1, 'В наши дни в самом центре старинного Томска, спрятанный от шума и суеты города, расположился старый замок. Ресторан «Старый Замок». Мы с особой заботой постарались воссоздать сказочную атмосферу средневекового замка. Пройдитесь по его великолепным Залам, полюбуйтесь яркой игрой солнца на витражных окнах и красотой настенных панно, оцените по достоинству фирменные блюда из нашего обширного меню и попробуйте изысканные вина со всех концов Света из нашего погреба. Насладитесь волшебными мелодиями в исполнении лучших музыкантов нашего города.', 0, 56.48207, 84.95112, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/oldCastle/', 'Старый Замок', 'https://sz.tomsk.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4501', 1000, 1, 'Приятный отдых и гастрономические наслаждения в трактире «Золотая долина» Уютный и гостеприимный трактир «Золотая долина» приглашает любителей сытной, вкусной пищи, приятного отдыха, ярких позитивных эмоций. В нашем заведении царит теплая душевная атмосфера, играет живая музыка, организуются интересные развлечения. Виртуозные шеф-повара удовлетворят предпочтения самого притязательного гурмана, а вежливые профессиональные официанты удовлетворят безупречным сервисом. Мы с радостью встретим компанию друзей, создадим волшебный антураж для романтического ужина, организуем праздничный банкет. Трактир «Золотая долина» – оазис для истинных гурманов. Одной из целей посещения заведения общепита является услаждение вкусовых рецепторов, утоление чувства голода. В наш трактир вы можете прийти в любое время для сытного обеда, ужина. Гарантиями удовлетворения любых вкусов, предпочтений являются: Два вида меню. Широкий ассортимент. Наличие блюд различных кухонь. Обширная барная карта.', 2, 56.49067, 84.94861, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/goldValley/', 'Золотая долина', 'https://zoldolina.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4502', 600, 1, 'Все дороги мира ведут в Рим, все дороги Томска ведут в «Перчини»', 1, 56.48831, 84.97838, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/perchini/', 'Перчини', 'http://perchinivtomske.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4503', 3000, 1, 'Те, кто хоть раз побывал в Томске, знают: это особенный город, пронизанный атмосферой тихих старинных улочек и энергичным ритмом современности. Город, дарящий ощущение полноты жизни, гостеприимный и хлебосольный. Город, где встречает гостей трактир «Вечный зов», соединивший в себе лучшие традиции качества и отношения к своему делу. В трактир приходят, приезжают, прилетают, чтобы отведать кушанья и подивиться явствам, которые приготовлены с душой и поданы с любовью. Здесь побывали многие российские звезды эстрады и кино. А в 2006 году «Вечный зов» посетил президент России В.В.Путин и канцлер Германии А.Меркель. В приятной дружественной обстановке они отведали котлеты из медвежатины с брусникой, сибирские пельмени и блинчики.', 3, 56.47139, 84.9529, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/eternalCall/', 'Вечный зов', 'https://vechzov-tomsk.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4504', 300, 1, 'С 5 января 2013 г. в Доме Путешественника открыто кафе вегетарианской кухни «РАДХИКА». Это новое место, уже хорошо известной томичам вегетарианской кухни «РАДХИКА», отличающейся разнообразием блюд приготовленных с любовью из натуральных продуктов. У нас можно: приятно отдохнуть, окунуться в мир любопытных вкусов и запахов, попробовать разнообразные вегетарианские блюда и здоровые напитки, насладиться фирменными десертами, заказать тортик, провести банкет и другое торжество, заказать доставку, приобрести хлеб и другие продукты магазина', 0, 56.47908, 84.95217, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/radxika/', 'Радхика', 'http://caferadhika.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4505', 600, 1, 'Первый гриль-бар «ШашлыкоFF» был открыт в центре Новосибирска в 2009 году – и моментально стал популярным, благодаря вкусному и доступному шашлыку. SRP-group – это: для всех – вкусная еда из свежих и качественных продуктов; постоянно – достойный сервис для наших гостей; всегда – уютный интерьер и атмосфера хорошего настроения. Наши гриль-бары – для вас! Главное – чтобы вам было комфортно. Наша концепция – демократичность, хорошая кухня и высокое качество обслуживания. Все это вы найдете в гриль-баре «ШашлыкоFF». Вкусные, сочные шашлыки и стейки. Приветливый персонал. Цены, которые не бьют по карману. Ну, и конечно, стильный интерьер, мягкие диваны, столы для больших и маленьких компаний. И теплые пледы, которые передадут вам наше тепло. Вам захотелось окунуться в эту дружественную, светлую атмосферу? Так приходите скорее! Нас легко найти: гриль-бары «ШашлыкоFF» есть практически в каждом районе города. В гриль-барах «ШашлыкоFF» мы предлагаем вам самое лучшее! Наши блюда гриль мы готовим только из охлажденного мяса, потому, что в нем сохраняются все полезные витамины и микроэлементы. Каждое блюдо мы готовим, как для себя: тщательно следим за процессом прожарки, с любовью переворачиваем каждый кусочек. Мы уделяем огромное внимание вкусу наших блюд. И отдаемся процессу приготовления полностью – ведь это наша работа.Только один шашлык есть неинтересно, поэтому мы позаботились о гарнире. Хрустящая картошечка, маринованный лучок, салат и фирменный соус идеально дополняют кулинарную картину!', 2, 56.49379, 84.94989, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/shashlikof/', 'Шашлыкоff', 'https://tomsk.shashlikoff.com/'),
