        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4515', 600, 1, 'Ресторанный комплекс Дом пива «У Крюгера» это легендарное заведение, где сложились свои традиции. Он был открыт в 2001 году. Его называют  достопримечательностью города Томска. Мы рады удивить наших гостей изысканностью интерьеров, богатым выбором блюд, и , конечно же, томским пивом.. Одно из уникальных преимуществ нашего ресторанного комплекса - это близость к заводу ОАО «Томское пиво»: все сорта, и в том числе новинки в первую очередь поступают к нам.', 3, 56.46231, 84.94252, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/uKrugera/', 'У Крюгера', 'http://ukrugera.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4516', 250, 1, '', 0, 56.46419, 84.99191, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Fize/', 'Файз', 'К сожалению ссылка отсутствует :('),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4517', 500, 1, '#REBRO — уютное место, где на открытой кухне готовят натуральное мясо, овощи и бургеры по честной цене. К нам приходят весело пообедать с друзьями, просто поболтать или обсудить деловые вопросы. У нас собственное производство: от булочек для бургеров до морсов. В наличии крафтовое пиво.', 0, 56.47708, 84.95063, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Rebro/', '#RE:BRO', 'https://tsk.rebrorussia.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4518', 450, 1, 'Ежедневно в рестораны БУРГЕР КИНГ во всем мире приходит более одиннадцати миллионов посетителей. И неудивительно: ведь наши рестораны известны вкусом фирменных блюд и отличным соотношением цены и качества. Основанный в 1954 году, БУРГЕР КИНГ занимает второе по величине место в мире среди сетей ресторанов быстрого питания, специализирующихся на гамбургерах. Оригинальный бургер «Воппер», ставка на ингредиенты высшего качества, фирменные рецепты и комфорт для посещения всей семьей — вот то, что уже пятьдесят с лишним лет успешной работы является отличительной чертой нашего бренда.', 1, 56.48721, 84.97959, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/BurgerKing/', 'Бургер Кинг', 'https://burgerkingrus.ru'),
