        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4520', 333, 1, 'Обычно люди приходят в Додо Пиццу, чтобы просто поесть. Наши промоутеры раздают листовки про кусочек пиццы за двадцать рублей или ещё что-то выгодное. Мы делаем это как первый шаг, чтобы познакомиться. Но для нас Додо — не только пицца. Это и пицца тоже, но в первую очередь это большое дело, которое вдохновляет нас, заставляет каждое утро просыпаться и с интересом продолжать работу.', 0, 56.48179, 84.94953, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Dodo/', 'Додо Пицца', 'https://dodopizza.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4521', 333, 1, 'Обычно люди приходят в Додо Пиццу, чтобы просто поесть. Наши промоутеры раздают листовки про кусочек пиццы за двадцать рублей или ещё что-то выгодное. Мы делаем это как первый шаг, чтобы познакомиться. Но для нас Додо — не только пицца. Это и пицца тоже, но в первую очередь это большое дело, которое вдохновляет нас, заставляет каждое утро просыпаться и с интересом продолжать работу.', 3, 56.46204, 84.95009, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Dodo/', 'Додо Пицца', 'https://dodopizza.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4522', 700, 1, 'Наша кухня сочетает в себе бережное отношение к традициям и безукоризненность во всём: от приготовления до подачи. К нам приходят, чтобы насладиться шедеврами грузинской и итальянской кухни: вас ждут тающая во рту пицца, ароматная паста, нежнейшие салаты, сочные хинкали и многое другое. В наличии имеется вино. Внимательный и предупредительный персонал поможет выбрать напиток в зависимости от повода и настроения.', 0, 56.47635, 84.95619, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/hinkaliGali/', 'ХинКали-GaлИ', 'https://pdpizza.com/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4523', 400, 1, 'Добро пожаловать в Pho Tigers! Кафе азиатской кухни в самом центре Томска. Фо-Бо, Том Ям, Рамен, Воки, а так же другие популярные блюда азиатской кухни!', 0, 56.48178, 84.94951, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/PhoTigers/', 'Pho Tigers', 'http://photigers.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4524', 700, 1, 'Наша кухня сочетает в себе бережное отношение к традициям и безукоризненность во всём: от приготовления до подачи. К нам приходят, чтобы насладиться шедеврами грузинской и итальянской кухни: вас ждут тающая во рту пицца, ароматная паста, нежнейшие салаты, сочные хинкали и многое другое. В наличии имеется вино. Внимательный и предупредительный персонал поможет выбрать напиток в зависимости от повода и настроения.', 2, 56.5141, 84.97636, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/hinkaliGali/', 'ХинКали-GaлИ', 'https://pdpizza.com/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4525', 350, 1, 'Уютный ресторан в самом сердце Томска. Идеальное место, чтобы начать свой день лучшим кофе, в компании вкусного завтрака! В обеденное время, мы предлагаем разнообразный и быстрый бизнес-ланч.', 0, 56.48179, 84.94949, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/dolce/', 'Dolce', 'https://dolce-tsk.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4526', 350, 1, 'Семейная кофейня. В меню можно встретить весовые салаты, сэндвичи и десерты, которые можно взять домой. Есть маленький детский уголок. В обеденное время мы предлагаем разнообразный и быстрый бизнес-ланч. Мы разрешаем принести свой алкоголь к нам в кофейню. Так же всегда можно заказать доставку по телефону', 2, 56.50241, 84.95155, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/dolce/', 'Dolce', 'https://dolce-tsk.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4528', 900, 1, 'Gelateria (c итал. – кафе мороженого) – это место, где готовят и подают натуральное итальянское мороженое сделанное по эксклюзивному рецепту. Оно безумно вкусное и совсем недорогое. Мы искренне утверждаем, что нежный, натуральный вкус итальянского мороженого способен добавить массу удовольствия к любому событию, происходящему в нашей повседневной жизни. ARTE DEL GUSTO (с итал. – Искусство вкуса) – это плод многолетней работы профессиональной команды, которая внедряет и развивает эту уникальную концепцию в России с 2014 года. На сегодняшний день уже запущены кафе в Томске, Ярославле, Санкт-Петербурге, которые успешно развиваются и с каждым годом привлекают к себе внимание все большей аудитории ценителей изумительного итальянского мороженного, оригинальных авторских десертов и традиционной итальянской кухни, а именно: пиццы, пасты, спагетти, ризотто, панини и других блюд. Наша главная задача - сделать удовольствие каждого гостя от посещения нашего кафе многомерным. Ежедневно Вас ожидают понимающий, внимательный персонал, несколько десятков разнообразных десертов, включая веселое «детское меню», незабываемая атмосфера праздника и торжества вкуса. И, пожалуйста, будьте уверены, что каждый день мы начинаем с вопроса, что еще предпринять, чтобы наши гости, чувствовали себя более комфортно, а их визиты к нам стали бы традицией на много поколений вперед.', 1, 56.48831, 84.97842, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Gelateria/', 'Gelateria Italiana', 'https://gelateria-russia.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4529', 500, 1, 'Здесь Вы найдёте: 1) Ваши любимые блюда из нашего постоянного меню кафе «Хуторок» 2) Приятные новые блюда от нашего шеф-повара 3) Множество блюд на предзаказ для вашего праздничного стола или фуршета', 1, 56.49929, 85.07431, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/xutorok/', 'Хуторок', 'https://hutorok-tomsk.ru/'),
        ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4530', 350, 1, 'Принципы работы Yoki Toki:• БЫСТРО Главный ресурс каждого нашего гостя — это время, и мы его ценим! Все наши блюда готовятся от 5 до 20 минут • ДОСТУПНО Мы заботимся о каждом нашем госте и экономим не только его время, но и деньги! Горячие блюда в Yoki Toki — от 99₽ • КАЧЕСТВЕННО Один из наших главных принципов — низкой должна быть только цена! Поэтому каждое блюдо готовится и подаётся гостю на самом высоком уровне Yoki Toki — единственное заведение формата Fast Casual, предлагающее традиционные блюда Азиатской кухни в Томске Каждое наше блюдо приготовлено с учётом всех особенностей кухонь Южной Азии, Индии, Тайваня и др., так что любой, самый изысканный гурман найдет в Yoki Toki то, что полностью удовлетворит его вкус!', 3, 56.46433, 84.95654, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/yokiToki/', 'Yoki Toki', 'https://yokitoki.ru/'),
