    ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4530', 700, 1, 'Кафе Багет-Омлет — это винный бар. Здесь вы можете приятно провести время с друзьями или просто оставить волнующие мысли после рабочих будней, а в этом вам с радостью помогут наши опытные бармены и ассортимент алкоголя — мы приготовили варианты горячительного, которые вам определённо понравятся! А вы выбираете желаемый градус и вкус (сладкий или горьковатый). В нашей винной карте мы предлагаем богатый выбор сухих, полусладких, крепких вин из разных сортов винограда.', 3, 56.47027, 84.95179, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Buget/', 'Baget Omlet', 'https://baget-omlet.obiz.ru/'),
    ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4530', 700, 1, 'Повар-Бар Кухня подарит вам, незабываемый вкус блюд разных стран мира, приготовленных с любовью. А также сервис, к которому вам захочется возвращаться снова и снова. Наша служба доставки создана для того, чтобы вы могли порадовать себя восхитительной кухней, не выходя из дома или офиса.', 3, 56.45866, 84.95625, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Kuxnya/', 'Кухня', 'https://kuhnya-tomsk.ru/'),
    ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4530', 300, 1, 'Уютная атмосфера Хинкали-Туна позволяет посетителям отдохнуть после рабочего дня. В этом кафе вы сможете насладиться блюдами армянской и русской кухонь.', 3, 56.45478, 84.97071, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/HinkalyTun/', 'КухняХинкали-Тун', 'К сожалению ссылка отсутствует :('),
