    ('a85b5de6-ffdb-459d-b9ec-d1fff0f3d4530', 1000, 1, 'Гриль-бар "Галерея" - это классический бар в историческом центре города Томска. С 2011 года мы профессионально подбираем, правильно храним и наливаем пиво с разных концов света. Вас ждут традиционная кухня, блюда гриль, сибирские деликатесы, хорошая барная карта, три уютных зала, расположенных на двух этажах. Ждем в гости старых и новых друзей!', 0, 56.47922, 84.94818, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Galery/', 'Галерея', 'https://vk.com/galereyagrillbar'),
